import CampaingModel from '../../../models/campaing'
import { ContentContainer } from './styles'
import SummaryCard from '../../../components/CampaingElements/SummaryCard'

interface Props {
  campaings?: CampaingModel[]
}

const CampaingsTab = ({ campaings }: Props) => {
  return (
    <ContentContainer>
      {campaings? (
        campaings.map((campaing, index) => (
          <SummaryCard key={index} id={campaing.id} name={campaing.name} income={2000} totalClicks={300} totalProductPage={100} totalCheckoutPage={50} totalPaidClicks={10} />
        ))
      ) : (
        'Nenhuma campanha foi criada até o momento.'
      )}
    </ContentContainer>
  )
}

export default CampaingsTab
